import React from 'react'; 



const FaceRecognition = ({imgUrl}) => {
    return (   
       <div className='center ma mt2'  >
           <img  alt='multi faces photo' src={imgUrl} width='500px' height='auto' />
           
        </div> 
    );
}

export default FaceRecognition;
